import React from 'react'
import { AppRouter } from './components/AppRouter'
import { connect } from "react-redux";
import Aux from "./components/Aux";
import { Landing } from "./components/Landing";

class App extends React.Component {
  render() {
    return(
      <Aux>
        <AppRouter/>
        <Landing/>
      </Aux>
    )
  }
}
export default App
